import React, { Component } from 'react';
import './style.css';

class VolunteerExperience extends Component {
  render() {
    return (
      <div>
        {this.props.coming && (
          <div>
            <h3 className="volunteer-experiences-subtitle">Coming experiences:</h3>
            <ul className="volunteer-coming-experience-list">
              <li className="volunteer-experience-item">{this.props.title}</li>
              <button className="delete-button" onClick={this.props.deleteExperience}>Delete</button>
              <button className="completed-button" onClick={this.props.completedExperience}>Completed</button>
            </ul>
          </div>
        )
        }
        {!this.props.coming && (
          <div>
            <h3 className="volunteer-experiences-subtitle">Past Experiences:</h3>
            <ul className="volunteer-past-experiences-list">
              <li className="volunteer-experience-item" key={experience.id - `${count += 1}`}>{experience.title}</li>
              <button className="delete-button" value={experience.id} onClick={this.deleteExperience}>Delete</button>
            </ul>
          </div>
        )}
      </div>
    )
  }
}
export default VolunteerExperience;
